import React from "react";
import SearchArea from "./components/SearchArea/SearchArea";
import "./App.css";

function App() {
  const [searchResult, setSearchResult] = React.useState("");
  const [inputText, setInputText] = React.useState("");

  React.useEffect(() => {
    const url = `https://api-football-v1.p.rapidapi.com/v2/players/search/svensson`;
    const accessHost = process.env.REACT_APP_FOOTBALL_HOST_KEY;
    const accessToken = process.env.REACT_APP_FOOTBALL_API_KEY;

    if (!inputText) {
      return;
    }

    fetch(url, {
      method: "GET",
      headers: {
        "x-rapidapi-host": "api-football-v1.p.rapidapi.com",
        "x-rapidapi-key": "3ab6deee7emsh797e9c862fb49b2p16f155jsn63530ff116f9",
      },
    })
      .then((res) => res.json())
      .then((data) => {
        const player = data.Player.find(({ Player }) => Player === inputText);
        setSearchResult(player);
      })
      .catch((err) => {
        console.log(err);
      });
  }, [inputText]);

  return (
    <div className="App">
      <SearchArea />
      <h1>Hej!</h1>
    </div>
  );
}

export default App;
